import React from 'react';
import { Button, IconButton, Tooltip } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import PeopleOutlineTwoToneIcon from '@mui/icons-material/PeopleOutlineTwoTone';
import { createMuiTheme } from '@material-ui/core/styles';

import './AddNewStaffButton.css';

const useStyles = makeStyles({
  tooltip: {
    fontSize: "1em",
  },
});

const AddNewStaffButton = () => {
  const navigate = useNavigate();

  return (
    <div className='addButton'>
      <Tooltip
        title='Προσθήκη Προσωπικού'
        placement='left-start'
        style={{
          fontSize: '20px'
        }}>
        <IconButton onClick={() => navigate('/staffs/create')}>
          <PeopleOutlineTwoToneIcon
            style={{
              textTransform: 'none',
              fontSize: '60px',
              color: "#03074f"
            }}
          />
        </IconButton>
      </Tooltip>
      {/* <Button
        title='Δημιουργία'
        onClick={() => navigate('/staffs/create')}
        variant="contained"
        style={{
          textTransform: 'none',
          padding: '10px',
          margin: '5px',
          backgroundColor: "#03074f"
        }}>
        Δημιουργία
      </Button> */}
    </div>
  )
}

export default AddNewStaffButton;
